import React from "react";
import "./page.css"

let pageProps = {
    color: "white"
}

const styleSet = {
    backgroundColor: "white"
}

class Page extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            pos: 0
        }
        this.style_set = styleSet
        styleSet.backgroundColor = props.color
    }

    render() {
        return (
            <div className="page-app" style={this.style_set}>
            </div>
        );
    }
}

export default Page
